import React, { useState, useEffect } from "react";
import { Route, Routes } from "react-router-dom";
import axios from "axios";

import { MyTime, TimeData, TodayTime, HabitTime } from "src/components";
import { StList } from "src/components";
import { MainPage, TimesPage } from "./pages";
import { InfoPage } from "./pages/info";
import { AuthPage } from "./pages/auth";
import { TeacherForm } from "src/components";

import styled from "@emotion/styled";
import { Link } from "react-router-dom";

export const NavbarContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;

  z-index: 2;
  padding-top: 2.5rem;
  color: white;
  background: #ffffff;
  font-weight: bold;
  display: flex;
  justify-content: space-between;
  align-items: center;
  font-family: Pretendard;
  border-bottom: 0.1rem solid #c6c6c6;
`;

export const NavbarLogo = styled.img`
  width: 32.6rem;
  object-fit: contain;
`;

export const NavbarText = styled.div`
  display: flex;
  width: 100%;
  padding-bottom: 2rem;
  padding-left: 10vw;
`;

export const NavbarFormGroup = styled.div`
  display: flex;
  width: 100%;
  padding-bottom: 2rem;
  padding-left: 80vw;
  @media screen and (max-width: 76rem) {
    padding-left: 70vw;
  }
  @media screen and (max-width: 57rem) {
    padding-left: 68vw;
  }
  @media screen and (max-width: 40rem) {
    padding-left: 60vw;
  }
  @media screen and (max-width: 32rem) {
    padding-left: 50vw;
  }
`;

export const NavbarMyPlanContainer = styled.div`
  padding-right: 48vw;
`;

export const NavbarMyPlan = styled(Link)`
  text-decoration: none;
  color: black;
`;

export const NavbarLogout = styled(Link)`
  padding-left: 23vw;
  text-decoration: none;
  color: black;
`;

export const NavbarA = styled(Link)`
  font-size: 1.5rem;
  margin-left: 2vw;
  margin-right: 2vw;
  text-decoration: none;
  color: black;
  @media screen and (max-width: 76rem) {
    margin-left: 3vw;
    margin-right: 3vw;
  }
`;

export const NavbarAContainer = styled.div``;

export const loggedInContainer = styled.div``;

export const TextSet = styled.div`
  margin-top: 0.4rem;
`;

export const Logout = styled.button`
  border: none;
  background-color: #fff;
  font-weight: 700;
`;

export const App: React.FC = () => {
  const [authState, setAuthState] = useState({
    user_name: "",
    id: "",
    status: false,
  });

  const [teaState, setTeaState] = useState({
    t_job: "",
    status: false,
  });

  useEffect(() => {
    axios
      .get("http://localhost:8080/auth/auth", {
        headers: {
          accessToken: localStorage.getItem("accessToken") as any,
        },
      })
      .then((response) => {
        if (response.data.error) {
          setAuthState({ ...authState, status: false });
          setTeaState({ ...teaState, status: false });
        } else {
          setAuthState({
            user_name: response.data.user_name,
            id: response.data.id,
            status: true,
          });
          setTeaState({
            t_job: response.data.t_job,
            status: true,
          });
        }
      });
  }, []);

  const logout = () => {
    localStorage.removeItem("accessToken");
    setAuthState({ user_name: "", id: "", status: false });
    setTeaState({ t_job: "", status: false });
  };
  return (
    <>
      <NavbarContainer>
        <NavbarFormGroup>
          {!authState.status ? (
            <>
              <NavbarA to="auth/login">로그인</NavbarA>
              <NavbarA to="auth/register">회원가입</NavbarA>
            </>
          ) : (
            <>
              {teaState.t_job === "teacher" ? (
                <></>
              ) : (
                <Link
                  style={{ textDecoration: "none", marginRight: "2vw" }}
                  to={`/myinfo/myplan/${authState.id}`}
                >
                  <div style={{ color: "black" }}>{authState.user_name}</div>
                </Link>
              )}
              {teaState.t_job === "teacher" ? (
                <NavbarA to="st/list">
                  <TextSet>학생관리</TextSet>
                </NavbarA>
              ) : (
                <></>
              )}
            </>
          )}
          {authState.status && <Logout onClick={logout}>Logout</Logout>}
        </NavbarFormGroup>
      </NavbarContainer>
      <Routes>
        <Route index element={<MainPage />} />
        <Route path="time">
          <Route path="today" element={<TimesPage />} />
          <Route path="habit" element={<TimesPage />} />
          <Route path="goal" element={<TimesPage />} />
        </Route>
        <Route path="timedata/:id" element={<TimeData />} />
        <Route path="auth">
          <Route path="login" element={<AuthPage />} />
          <Route path="register" element={<AuthPage />} />
          <Route path="teacher" element={<TeacherForm />} />
        </Route>
        <Route path="myinfo">
          <Route path="myplan/:id" element={<InfoPage />} />
          <Route path="profile/:id" element={<InfoPage />} />
        </Route>
        <Route path="st">
          <Route path="list" element={<StList />} />
        </Route>
      </Routes>
    </>
  );
};
